						["unit"] = "player",
						["custom_hide"] = "custom",
						["custom"] = "function(event, ...)\n    if not aura_env.parentFrame then\n        aura_env.parentFrame = WeakAuras.GetRegion(aura_env.parent)\n    end\n    \n    local frame = aura_env.parentFrame\n    \n    if frame then\n        local cfg = LWA[aura_env.CLASS].GetConfig(\"alpha\")\n        local alpha = cfg.global\n        \n        if \"BARBER_SHOP_OPEN\" == event then\n            alpha = 0\n        else\n            if not UnitAffectingCombat(\"player\") then\n                alpha = min(alpha, cfg.ooc)\n            end\n            \n            if UnitExists(\"target\") then\n                local isEnemy = UnitCanAttack(\"player\", \"target\") or UnitIsEnemy(\"player\", \"target\")\n                \n                if (not isEnemy and cfg.ignore_friendly) or (isEnemy and cfg.ignore_enemy) then\n                    alpha = cfg.global\n                end\n            end\n        end\n        \n        frame:SetAlpha(alpha / 100)\n        \n        return true\n    end\n    \n    return false\nend",
